import React from 'react'
import styled from 'styled-components'

const TimeDay = styled.div`
    display: flex;
    width: 400px;
    height: 100px;
    margin-top: 150px;

    hr{
        transform: rotate(90deg);
        border: none;
        height: 1px;
        /* Set the hr color */
        color: #333; /* old IE */
        background-color: #333; /* Modern Browsers */
    }
`

export default function DayTime(){
    return(
        <TimeDay>
            <hr />
        </TimeDay>
    )
}
